import Vue from 'vue'
import 'reset-css'
import App from './App.vue'
import '@/plugins/element/index'
import router from '@/router'

Vue.config.productionTip = false


const render = ()=>{
  const app = new Vue({
    render: h => h(App),
    router
  })
  app.$mount('#app');
}

render();
